import React from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/journal">Journal</Link></li>
        <li><Link to="/insights">Insights</Link></li>
        <li><Link to="/goals">Goals</Link></li>
        <li><Link to="/settings">Settings</Link></li>
      </ul>
    </nav>
  );
};

export default Nav;
